                  <span class="label">交通出行：</span>
                  <span class="text">小区位于东五环，处于常营、黄渠地铁站中间，出小区步行没多久就可以到达地铁站。小区有电动摆渡车往返于地铁站跟小区之间，高峰期会有2分钟一趟的电动车，电车从西门进去，东门出来，再绕着南门从西门回到黄渠地铁站。小区门口就是公交站牌-常营路口南...</span>
                </li>
                             <li>
                  <span class="label">周边配套：</span>
                  <span class="text">周边各大超市齐全，购物方便。出小区往东走1000米就是龙湖集团斥45.9亿巨资打造的常营长楹天街商圈，集休闲娱乐于一体的好去处，满足您的日常生活需求。小区西边有欧尚超市，位于小区小东门边上有适佰家生活超市，买菜的话小区往南走400米到达东苇路市场。..</span>
                </li>
